    "2013-03-14T19:27:10.936957",nt"name": "california-aquatic-non-native-organism-database-canod-ds503",nt"isopen":
    false,nt"url": null,nt"notes": "The data provided are from a database known
    as CANOD (California Aquatic Non-native Organism Database), which contains the name
    and location of every known non-native species on the California coast. OSPR manages
    CANOD. The data provided from CANOD to BIOS include the introduced species name
    and location, date observed, and habitats observed. CANOD includes species lists
    and other associated information for both non-native and native coastal aquatic
    species in California. New records are being added continually, and existing records
    are frequently updated and modified as new information becomes available. As such,
    CANOD is a dynamic database, so users should ensure that they have the most current
    copy of the database before making use of the data. CANOD is an accumaltion of literature
    review, data collected by other entities, and OSPR field surveys. OSPR began surveying
    in 2000 and continues to monitor for new introductions. Records before the year
    2000 are from literature review and surveys by other entities.",nt"license_title":
